import os

# ==================================================
# INLINE APP CONFIG (NO .env FILE)
# ==================================================
INLINE_CONFIG = {
    # Used in form12bb.py & declaration.py
    "DEFAULT_USER_ID": "1",

    # Used in file upload validation
    "MAX_UPLOAD_MB": "5",
}

def env(key: str, default=None):
    """
    Reads from OS env if present,
    otherwise falls back to INLINE_CONFIG.
    No .env file is required.
    """
    return os.environ.get(key, INLINE_CONFIG.get(key, default))

# ==================================================
# APPLICATION SETTINGS
# ==================================================
DEFAULT_USER_ID = int(env("DEFAULT_USER_ID", "1"))
MAX_UPLOAD_MB = int(env("MAX_UPLOAD_MB", "5"))

# ==================================================
# FORM12BB TEMPLATE (OPTIONAL)
# ==================================================
TEMPLATE_PDF_BASE64 = os.environ.get("TEMPLATE_PDF_BASE64", "")
